import React, { Component } from 'react';
import Button from '../../../pageSettings/button/Button';
import Layout from '../../layout/Layout';


export default class AddMotherboard extends Component {
  state = {
    model: '',
    cpu_socket_support: '',
    chipset: '',
    form_factor: '',
    M2Slot: '',
  };

  async handleSubmit(e) {
    e.preventDefault();
    //  const { model, cpu_socket_support, chipset, form_factor } = this.state;
    console.log(this.state);
    const options = {
      method: 'POST',
      crossDomain: true,
      headers: {
        'Content-Type': 'application/json',
        Accept: 'application/json',
        'Accept-Control-Allow-Origin': '*',
      },
      body: JSON.stringify(this.state),
    };
    const response = await fetch(
      'http://localhost:5000/insert/motherboard',
      options
    );
    const result = await response.json();
    console.log(result);
  }

  render() {
    return (
    
      <div>
        <form onSubmit={this.handleSubmit.bind(this)}>
          <label htmlFor=''>
            <input
              type='text'
              placeholder='Enter a Model:'
              value={this.state.model}
              onChange={e => this.setState({ model: e.target.value })}
            />
          </label>
          <label htmlFor=''>
            <input
              type='text'
              placeholder='cpu_socket_support:'
              onChange={e =>
                this.setState({ cpu_socket_support: e.target.value })
              }
            />
          </label>
          <label htmlFor=''>
            <input
              type='text'
              placeholder='chipset:'
              onChange={e => this.setState({ chipset: e.target.value })}
            />
          </label>
          <label htmlFor=''>
            <input
              type='text'
              placeholder='form_factor:'
              onChange={e => this.setState({ form_factor: e.target.value })}
            />
          </label>
          <label htmlFor=''>
            <input
              type='text'
              placeholder='M.2 slot:'
              onChange={e => this.setState({ M2Slot: e.target.value })}
            />
          </label>
          <Button type='submit' text='submit' />
        </form>
      </div>
    );
  }
}
